sys_variable_value.value:
(function execute(inputs, outputs) {
  var q = new GlideRecord('x_fmcna_armis_inte_armis_integration_configuration')
  q.addQuery('key',inputs.key)
  q.query()
  outputs.debug = inputs.key
  if (q.getRowCount() > 0)
  {
    q.next()
    outputs.value = q.getValue('value')
  }
})(inputs, outputs);

